import React from 'react'

function Skill() {
  return (
    <div className="md:flex items-center w-1/2 px-3">
    <div className="mr-4  text-center">
      <span className="text-lg font-bold text-gray-700">Skill Acquired</span>
    </div>
    <div className="flex-1 border-t border-red-500 my-4"></div>
  </div>
  )
}

export default Skill
